            })
    }, [])


    return (
        <div className="center_container">
            <Navbar />
            <div className="main_center_content_wrapper">
                <div className="main_outer_content">
                    <div className="main_outer_heading">Student reviews</div>
                </div>
                <div className="main_center_content">
                    {
                        uploads.length > 0 ? (
                            uploads.map((upload, index) => <ReviewListItem data = {upload} index = {index} />)
                        ) : (
                            <div>empty</div>
                        )
                    }
                </div>
                <div className="main_outer_content right_bound_outer_content">

                </div>
            </div>
        </div>
    );
};

export default Reviews;
